import React from 'react';
import ReactDOM from 'react-dom';
import Card from './component/Card';
import Sdata from './Sdata';

ReactDOM.render(
  <>
    <h1 className='heading_style'>Top 5 Original Netflix seriese in 2021</h1>
    <Card 
    imgsrc = {Sdata.imgsrc} 
    title = {Sdata.title}
    sname = 'Cobra Kai'
    link = 'https://www.netflix.com/bd/title/81002370'  />

    <Card 
    imgsrc = 'https://encrypted-tbn3.gstatic.com/images?q=tbn:ANd9GcRU_HEs2FNU56maiYdNu8rdKzFkCyw15CjFG38h-g-qM5yDb5FM' 
    title = 'A Netflix Original Series.'
    sname = 'The Last Kingdom'
    link = 'https://www.netflix.com/bd/title/80074249'  />

    <Card 
    imgsrc = 'https://encrypted-tbn1.gstatic.com/images?q=tbn:ANd9GcSyN85JQSuwzb6AXatDSoCIkzN-GdNWKTegJ6q0pbC-0jNnoLoQ' 
    title = 'A Netflix Original Series.'
    sname = 'The Witcher'
    link = 'https://www.netflix.com/bd/title/80189685'  />

  </>,
  document.getElementById("root")
);
